css:
@-moz-document domain("feedly.com") {
.theme--dark .content .title, .theme--dark .heading, .theme--dark .entryBody, .theme--dark .inlineFrame .title, .theme--dark .entryBody .content p  {
    color: #A6A6A6 !important;
}

.theme--dark .content .summary, .theme--dark .inlineFrame.read .title, .theme--dark .entry.u0.read .title {
    color: #515151 !important;
}

.feedlyBlocked, .theme--dark #feedlyPageHolderFX, .theme--dark .entryholder {
    background-color: #181818 !important;
}

.theme--dark #topHeaderBarFX {
    display: none;
}

}
